import styles from './styles.module.scss';

function ResumeSection({
    title,
    items,
    isTwoColumn,
}) {

    let list;
    const resumeItems = items.map((obj) =>
        <div key={obj.listHead.toString()} className={styles.resume_item}>
            <p className={styles.list_head}>{obj.listHead}</p>
            {list = obj.listItems.map((str) =>
                <p key={str.toString()} className={styles.list_items}>{str}</p>
            )}
        </div>
    )

    if (isTwoColumn == 'true') {
        return (
            <div className={styles.resume_section_container}>
                <h3 className={styles.left_content}>{title}</h3>
                <div className={styles.right_content_2}>
                    {resumeItems}
                </div>
            </div>
        )
    } else {
        return (
            <div className={styles.resume_section_container}>
                <h3 className={styles.left_content}>{title}</h3>
                <div className={styles.right_content}>
                    {resumeItems}
                </div>
            </div>
        )
    }
};

function Resume() {
    const educationItems = [
        {listHead:'Georgia Tech (Present)', listItems:['Bachelor of Science, Computational Media', 'Minoring in Industrial Design', 'Minoring in Global Development']},
        {listHead:'Tokyo Tech (Summer 2018)', listItems:['Summer Program in Sustainable Development']},
    ];

    const experienceItems = [
        {listHead:'BitPay', listItems:['Product Design Intern (Spring 2020)']},
        {listHead:'Spreetail', listItems:['Graphic Design Intern (Summer 2019)']},
        {listHead:'National Public Radio (NPR)', listItems:['Creative Intern (Fall 2019)']},
    ]

    const involvementItems = [
        {listHead:'Bits of Good', listItems:['Director of Design (Fall 2020)', 'Associate Director of Design (Spring 2020)', 'Product Designer (Fall 2019)']},
        {listHead:'HackGT', listItems:['Design Team Member (2018 - 2020)']},
    ]

    const expertiseItems = [
        {listHead:'Skills', listItems:['UX/UI', 'Wireframing', 'Prototyping', 'Visual Design', 'Front-end', 'Illustration']},
        {listHead:'Software', listItems:['Adobe CC', 'Figma / Sketch', 'Protopie / After Effects', 'VS Code / Sublime Text', 'HTML / CSS / JS', 'ReactJS / NextJS']},
    ]

    return(
        <>
            <h1>Resume</h1>
            <ResumeSection 
                title = 'Education'
                items = {educationItems}
                isTwoColumn = 'false'
            />
            <ResumeSection 
                title = 'Experience'
                items = {experienceItems}
                isTwoColumn = 'false'
            />

            <ResumeSection 
                title = 'Involvement'
                items = {involvementItems}
                isTwoColumn = 'false'
            />

            <ResumeSection 
                title = 'Expertise'
                items = {expertiseItems}
                isTwoColumn = 'true'
            />
        </>
    )
};

export default Resume;
